const RING2_INNER: f32 = RING1_OUTER;
const RING2_OUTER: f32 = RING1_OUTER + RING_WIDTH;
const RING3_INNER: f32 = RING2_OUTER;
const RING3_OUTER: f32 = RING2_OUTER + RING_WIDTH;

